            SET NEW.month_of_accumulation = MONTHNAME(NEW.start_date);
        ELSE
            SET NEW.month_of_accumulation = MONTHNAME(DATE_ADD(NEW.start_date, INTERVAL 1 MONTH));
        END IF;
    END IF;
END
$$
